  false,\n\t\"url\": null,\n\t\"notes\": \"Fiscal year 2012 final report for the inventory
  of vegetation structure and phenology at Kulm Wetland Management District.  The
  purpose of the study was to conduct a baseline inventory of vegetation structure
  and record phenological changes in vegetation on upland habitat types including
  native prairie, reconstructed prairie, and seeded introduced grasses that have received
  a range of defoliation treatments (principally grazing and fire). This information
  will be used as a tool to help guide future management of uplands by avoiding generic
  management prescriptions and focusing on implementing  management based on absolute
  measures of vegetation structure required by focal species and during identified
  management periods to enhance native prairie.\",\n\t\"license_title\": \"License
